public float getQueueMaxAMShareDefault() {
  Optional<String> value = getTextValue(QUEUE_MAX_AM_SHARE_DEFAULT);
  if (value.isPresent()) {
    float val = Float.parseFloat(value.get());
    return Math.min(val, 1.0f);
  }
  return 0.5f;
}
